import React, { Component } from "react";

class TagokComponent extends Component {
  render() {
    return (
      <div>
        <table className="tagokTable">
          <thead>
            <tr>
              <th>Nev</th>

              <th>Cim</th>

              <th>Egyesulet</th>

              <th>Fajtak</th>

              <th>Eredmenyek</th>
            </tr>
          </thead>
          <tbody>
              <tr>
                  <td>valaki1</td>
                  <td>valahol1</td>
                  <td>valami1</td>
                  <td>valamik1</td>
                  <td></td>
              </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default TagokComponent;
